import {useState} from 'react';
import './App.css';


function App() {

  let [board1,board2,board3] = useState([{'제목':'글제목1','내용':'글내용1'},{'제목':'글제목2','내용':'글내용2'},{'제목':'글제목3','내용':'글내용3'}]);

  let title = '투썸에서 리액트 개발';


  return (
    <div className="App">
      <div className="black-nav">
        <div>개발 Blog</div>

      </div>
      <h4>{title}</h4>
      <div>{board1.제목}</div>
      <div>{board1.내용}</div>
      <div>{board2.제목}</div>
      <div>{board2.내용}</div>
      <div>{board3.제목}</div>
      <div>{board3.내용}</div>
    </div>
  );
}

export default App;
